sys_hub_input_scripts.script:
{"request":{"scriptActive":true,"script":"try {
 var request = {}

var key = fd_data.subflow_inputs.key
var memo = fd_data.subflow_inputs.memo
var rsr = fd_data.subflow_inputs.rsr
var sign_with = fd_data.subflow_inputs.sign_with

gs.info("key " + key)
gs.info("memo " + memo)
gs.info("rsr " + rsr)
gs.info("sign_with " + sign_with)

if (key.public_key) { request.key = key.getValue("public_key") } 
if (memo) { request.memo = memo } 
if (rsr) { request.rsr = rsr }

if (sign_with) {
 request.sign = [] 
 while (sign_with.next()) {
 request.sign.push(sign_with.getValue("public_key"))
 }
}
} catch (e) {
 gs.error(e)
}
return JSON.stringify(request)
"}}

